        /// </summary>
        public string GetValueMeaning(Task task, int index)
        {
            if (task is null)
                throw new ArgumentNullException(nameof(task));

            if (task.ValueTypes is null || task.Values is null)
                return "No valueTypes/values present";

            // Defensive: convert to lists for indexed access because API uses ICollection.
            var typesList = task.ValueTypes.ToList();
            var valuesList = task.Values.ToList();

            if (index < 0 || index >= typesList.Count || index >= valuesList.Count)
                return "Index out of range for valueTypes/values";

            ulong typeCode = typesList[index];
            ulong value = valuesList[index];

            return GetValueMeaning(typeCode, (int)value);
        }

