            return label switch
            {
                "faction_id" => $"Faction: {ResolveEnemy(value)}",
                "is_personal_order" => $"Personal Order: {(value != 0 ? "Yes" : "No")}",
                "target" => $"Target: {value}",
                "enemy_id" => $"Enemy: {Resolve("enemy", value)}",
                "item_id" => $"Item: {Resolve("item", value)}",
                "planet_index" => $"Planet: {Resolve("planet", value)}",
                "sector_index" => $"Sector: {Resolve("planet", value)}",
                _ => $"{label}: {value}"
            };
