            if (task.ValueTypes is null || task.Values is null)
                yield break;

            var types = task.ValueTypes.ToList();
            var values = task.Values.ToList();
            int count = Math.Min(types.Count, values.Count);

            for (int i = 0; i < count; i++)
                yield return GetValueMeaning(types[i], (int)values[i]);
        }

        private string Resolve(string kind, int id)
        {
            if (string.IsNullOrWhiteSpace(kind))
                return string.Empty;

            switch (kind)
            {
                case "item":
                    return ResolveItem(id);

                case "planet":
                    return ResolvePlanet(id);

                case "enemy":
                    return ResolveEnemy(id);

                case "mission":
                    return ResolveMission(id);

                case "status":
                    return ResolveStatus(id);

                default:
                    return string.Empty;
            }
        }

        private static string ResolveStatus(int id) => "status";
        private static string ResolvePlanet(int id)
        {
            Planet p = HelldiversClient.client.GetApiV1PlanetsAsync(id, Helldivers2.SUPER_CONTACT_HEADER_VALUE, Helldivers2.SUPER_CLIENT_HEADER_VALUE).GetAwaiter().GetResult();
            return p.Name;
        }
        private static string ResolveMission(int id) => "Mission";
        private static string ResolveEnemy(int id) => id switch
        {
            1 => "Bugs",
            2 => "Illuminate",
            3 => "Automatons",
            _ => $"Unknown enemy ({id})"
        };
        private static string ResolveItem(int id) => "Item";

        public override string ToString()
        {
            var builder = new System.Text.StringBuilder();

            // Always show the task type description
            builder.Append(TypeDescription);

            if (Values == null || ValueTypes == null || Values.Count == 0 || ValueTypes.Count == 0)
                return builder.ToString();

            int count = Math.Min(ValueTypes.Count, Values.Count);

            IEnumerable<int> relevantIndexes = Enumerable.Range(0, count)
                .Where(i =>
                {
                    string label = ValueTypeLabel(ValueTypes[i]);
                    return label switch
                    {
                        "faction_id" => true,
                        "is_personal_order" => false,
                        "target" => true,
                        "enemy_id" => Type == 3 || Type == 12, // show for kill/defend tasks
                        "item_id" => Type == 2 || Type == 5 || Type == 10, // show for item-related tasks
                        "planet_index" => Type == 11 || Type == 14 || Type == 15,
                        "sector_index" => Type == 11,
                        _ => false
                    };
                });

            var decoded = relevantIndexes
                            .Select(i => GetValueMeaning(ValueTypes[i], (int)Values[i]))
                            .Where(s => !string.IsNullOrWhiteSpace(s))
                            .ToList();

            if (decoded.Count > 0)
            {
                builder.AppendLine();
                builder.AppendLine();

                foreach (var line in decoded)
                {
                    builder.Append("* ");
                    builder.AppendLine(line);
                }
            }

            return builder.ToString();
        }
